const HorizontalLine = (index, handleClick) => {
    return (
        <div className="hr_div">
            <div className="empty_hr_div"></div>
            <div id="h_line" onClick={() => handleClick(index)}></div>
            <div className="empty_hr_div"></div>
        </div>
    )
}

export default HorizontalLine;
